column78:
Equipamento apresentou falha dentro do período de garantia, porém não foram realizadas duas intervenções preventivas, improcedo a garantia do equipamento.
Em busca de resolvermos o problema do cliente, tendo em vista que a falha é conhecida e não possuindo correlação com os itens das preventivas, recorremos ao CBU Raphael na qual concedeu a execução dos serviços de forma excepcional.
Diante disto, torna-se contraditório as falas do cliente, tendo em vista que mesmo diante dos não cumprimentos das preventivas, ainda buscamos soluções para o problema para o seu problema.; Patrick, favor anexar as tratativas nas quais foram alinhadas no passado. Evidencie a data de contato feito com cliente e o motivo da demora no atendimento.;

Contato realizado com o cliente, o mesmo questionou o elevado tempo de reparo para processos de garantia. Porém todo questionamento do cliente trata-se de um atendimento que esta em andamento, no qual tivemos um tempo de espera de peças para realizar o atendimento.
Com relação ao atendimento da OS 1654 que foi realizado no mês de Abril/23, o atendimento foi feito dentro do período esperando onde atendemos o cliente 2 dias após a autorização conforme evidências em anexo.
Tendo em vista que a solicitação foi feita no dia 27/04 e o atendimento realizado em 28/04, peço revisar a pesquisa em questão pois o relato não refere-se a este atendimento.; O Cliente reclama com razão pelo o que foi reportado. É natural que ele expresse sua insatisfação ao ser procurado. Não é um motivo de revisão de pesquisa.; ; Ajuste de status. ;

Este atendimento, o cliente solicitava manutenlçao no vazamento de cilindro, onde foi exposto que o prazo seria de 03 dias úteis, e o cliente queria um atendimento em um dia.
Foi informado à ele este fluxo e este prazo, no acompanhamento e processamento da OS.
Vide evidências desta negocição em anexo.;

A nota dada para este atendimento, entendemos ser atribuída ao fato de ao executaros a revisão, termos encontrado problema no ar condicionado, e por não termos esta informação na solicitação do atendimento  ( era o atendimento de revisão) não enviamos o técnico preparado para executar esta atividade. Foi necessário agendar novo atendimento com técnico específico de ar condicionado.
Cliente teve histórico de insatisfação com folgas no H, que foram tratadas com a regulagem através de arruelas de ajuste, que ele não aceitou, inclusive solicitando a substituição dos braços do H ( ação que não era necessária, devido a folga estar dentro do especificado), mas a percepção do cliente era que não devia haver folga.

Enfim, entendemos que os pontos onde ele deu nopta zero, existem as evidências contrárias à sua nota..; Ajuste de status.;

Raphael, 

Mediante ao anonimato do cliente, não conseguimos verificar autenticidade da queixa. 

Nosso esforço é facilitar a experencia do cliente, nossos números de contato são divulgados em nossas redes sociais exaustivamente, os clientes podem interagir por lá. Temos um numero de whatsapp gera eventos em nosso CRM para atendimento. Além do contatos dos individual de nosso consultores. Infelizmente, sem nome do cliente não é possível validar o caso. ; Embora pesquisa anônima, cliente alega motivo pertinente ao pós-vendas e sua insatisfação. Revisão negada.; Sem plano de ação a ser traçado pelo cliente em função de pesquisa ser tratada de forma anônima. ; Ajuste de status. ;

Realmente, tivemos um problema com o consultor Marcelo Góis, que foi substituído pelo consultor Eduardo Maurício,
Realizamos contato com o cliente, explicamos nossas açoes  já tomadas e apresentei o novo consultor.
; ; Ajuste de status. ;

Em conversa com o Sr.: Isaias o mesmo relata que o equipamento apresenta "perda de força e superaquecimento", solicitação de atendimento feita na Segunda Feira onde o cliente enviou a localização do equipamento na Quarta Feira e realizamos o atendimento na Quinta Feira conforme anexos.
Visto que o atendimento foi feito em um período de 3 dias peço a revisão da pesquisa em questão pois realizamos o atendimento em tempo.; Em conversa com o Sr.: Isaias o mesmo relata que o equipamento apresenta "perda de força e superaquecimento", solicitação de atendimento feita na Segunda Feira onde o cliente enviou a localização do equipamento na Quarta Feira e realizamos o atendimento na Quinta Feira conforme anexos.
Visto que o atendimento foi feito em um período de 3 dias peço a revisão da pesquisa em questão pois realizamos o atendimento em tempo.; Motivo de reclamação do cliente não plausível de revisão de pesquisa, conforme boletim BOSS 002-2023 | Revisão de Pesquisas NPS (Pós-Vendas). Adicionalmente, evidências insuficientes para o pleito. Revisão de pesquisa negada. ;

Cliente nós contato para a revisão programada, porém ocorrou um serie de desencontros entre nossa disponibilidade de tecnicos e cliente conseguir parar a máquina para realização do serviço. 

- Entramos em contato com cliente e firmanos o compromisso de melhoria nos proximos atendimento. 
- Alterações no quatro de funionarios foram realizadas para promocaçã o de melhorias no atendimenot ao cliente;

Falei com Adriano. Relatou que tem atendimento em outras unidade da Bamaq. Porém, relatou dificuldade de retorno as suas solicitação. Informou que consultor é lento no retornos solicitados 

Plano de Ação :
Estamos investindo em plano treinamento para melhoria no padrão de qualidade.  ;

Estamos constantemente em ação quanto a preocupação das máquinas paradas. Tudo o possível foi feito para solução deste cliente, porém as peças tiverem um prazo para chegada a solução do cliente. 

- Atualmente temos uma pessoa dedica a cuidar dos processo e a evolução da correção dos equipamento que estão parados. 
- Para este cliente em questão a BAMAQ arcou com alguns custos do cliente. ; Favor apresentar plano de ação para a reclamação cliente. ; Plano de ação validado;

